function urut(n) { 
  var table2, rows, switching, i, x, y, shouldSwitch;
  table2 =document.getElementsByTagName('table')
      if(n==2){table2=table2[1] }
      if(n==1){table2=table2[0] }
   switching = true;
  while (switching) {
    switching = false;
    rows = table2.rows;
   
    for (i = 1; i < (rows.length - 1); i++) { 
      shouldSwitch = false;
      x = rows[i].getElementsByTagName("TD")[0];
    
      y = rows[i + 1].getElementsByTagName("TD")[0];
    
    //  if (Number(x.innerHTML) > Number(y.innerHTML)) 
   if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase())
   {
        shouldSwitch = true;
        break;
      }
    }
    if (shouldSwitch) {
      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
      switching = true;
    }
  }
    
  if(n==2){ 
      var bb=0; var kls='';var  table2 =document.getElementsByTagName('table')
     table2=table2[1]
     ctabel=table2
    var  rows = table2.rows;
     crows=rows
    let nom=''
    for (i = 1; i < (rows.length); i++) 
    { 
      
        
      if (i==1){kls=rows[i].cells[0].innerHTML}
      if(kls==rows[i].cells[0].innerHTML){
                 
                 bb++;
                 if(bb.toString().length<2){nom='&nbsp;&nbsp;'+bb}else {nom=bb}

                rows[i].cells[0].innerHTML=nom+"). "+kls
             }
       else {kls=rows[i].cells[0].innerHTML ;bb=0; bb++;rows[i].cells[0].innerHTML="&nbsp;"+bb+"). "+kls; }
      }
        
    }  
    
}

function cari() {
  var input, filter, table, tr, td, i, txtValue;
  input = document.getElementById("cari");
  filter = input.value.toUpperCase();
  table = document.getElementById("myTable");
  tr = table.getElementsByTagName("tr");
  for (i = 1; i < tr.length; i++) {
    td = tr[i].getElementsByTagName("td")[1];
  // alert(td.innerText)
    if (td) {
      txtValue = td.textContent || td.innerText;
      if (txtValue.toUpperCase().indexOf(filter) > -1) {
        tr[i].style.display = "";
      } else {
        tr[i].style.display = "none";
      }
    }       
  }
}
